// api.js

export const submitForm = async (formData) => {
    const response = await fetch('/submit-form', {
      method: 'POST',
      body: JSON.stringify(formData),
    });
    return response.json();
  };

  export const fetchForm = async (formId) => {
    const response = await fetch(`/forms/${formId}`);
    return response.json();
  };

  export const fetchAllForms = async () => {
    const response = await fetch('/forms');
    return response.json();
  };

  // If you need `getForms` and `saveForm`, define them like this:
  export const getForms = async () => {
    const response = await fetch('/forms');
    return response.json();
  };

  export const saveForm = async (formData) => {
    const response = await fetch('/save-form', {
      method: 'POST',
      body: JSON.stringify(formData),
    });
    return response.json();
  };
